import firebase from './firebase';
import React from 'react';
import './App.css';

function App() {

  React.useEffect(()=>{
    const msg=firebase.messaging();
    console.log(msg,"LA MENSAJERIA")
    msg.requestPermission().then(()=>{
      return msg.getToken();
    }).then((data)=>{
      console.warn("token",data)
    })
  })

  return (
    <div className="">

          Hi My Push Notification service   

    </div>
  );
}

export default App;
